protected SpanScorer(Spans spans, Weight weight, Similarity similarity, byte[] norms)
throws IOException {
  super(similarity);
  this.spans = spans;
  this.norms = norms;
  this.weight = weight;
  this.value = weight.getValue();
  if (this.spans.next()) {
    doc = -1;
  } else {
    doc = NO_MORE_DOCS;
    more = false;
  }
}

